(function(){var e=Backbone.Form;e.setTemplates({form:'      <form class="form-horizontal">{{fieldsets}}</form>    ',fieldset:"      <fieldset>        <legend>{{legend}}</legend>        {{fields}}      </fieldset>    ",field:'      <div class="control-group field-{{key}}">        <label class="control-label" for="{{id}}">{{title}}</label>        <div class="controls">          {{editor}}          <div class="help-inline">{{error}}</div>          <div class="help-block">{{help}}</div>        </div>      </div>    ',nestedField:'      <div class="field-{{key}}">        <div title="{{title}}" class="input-xlarge">{{editor}}          <div class="help-inline">{{error}}</div>        </div>        <div class="help-block">{{help}}</div>      </div>    ',list:'      <div class="bbf-list">        <ul class="unstyled clearfix">{{items}}</ul>        <div class="bbf-list-controls">          <button type="button" class="btn bbf-del" data-action="clear"> <i class="icon-trash"></i> '+__("BACKBONE_FORMS_LIST_CLEAR_BUTTON","Remover Todos")+' </button>          <button class="btn btn-primary bbf-add" data-action="add"><i class="icon-plus-sign"></i> '+__("BACKBONE_FORMS_LIST_ADD_BUTTON","Adicionar")+"</button>        </div>      </div>    ",listItem:'      <li class="clearfix">        {{editor}}        <button type="button" class="btn bbf-del" data-action="remove"> <i class="icon-trash"></i></button>      </li>    ',date:'      <div class="bbf-date">        <select data-type="date" class="bbf-date">{{dates}}</select>        <select data-type="month" class="bbf-month">{{months}}</select>        <select data-type="year" class="bbf-year">{{years}}</select>      </div>    ',dateTime:'      <div class="bbf-datetime">        <p>{{date}}</p>        <p>          <select data-type="hour" style="width: 4em">{{hours}}</select>          :          <select data-type="min" style="width: 4em">{{mins}}</select>        </p>      </div>    ',"list.Modal":'      <div class="bbf-list-modal">        {{summary}}      </div>    ',listField:'      <div>        {{editor}}        <div class="help-inline">{{error}}</div>        <div class="help-block">{{help}}</div>      </div>      '},{error:"error"})})();